var container = document.querySelector('.blog-masonry');
var masonry;
imagesLoaded( container, function() {
masonry = new Masonry( container, {
// options
itemSelector: '.blog-item',
columnWidth: '.grid-sizer',
percentPosition: true
});
});

var ias = jQuery.ias({
  container: ".blog-masonry",
  item: ".blog-item",
  pagination: ".pagination",
  next: ".pagination a"
});

ias.on('render', function(items) {
jQuery(items).css({ opacity: 0 });
});
ias.on('rendered', function(items) {
imagesLoaded( container, function() {
masonry.appended(items);
});

});

var m_text = more_posts.more_text;
var nm_text = more_posts.nmore_text;

ias.extension(new IASSpinnerExtension({
    src: 'data:image/gif;base64,', // optionally
}));
ias.extension(new IASTriggerExtension({text: m_text ,offset: 1}));
ias.extension(new IASNoneLeftExtension({text: '<span class="no-more-post">'+nm_text+'</span>'}));
ias.extension(new IASPagingExtension());